          <div className="bb">
            <a className='bl'>Battery</a>
            <a className='bl'>{batteryLevel}%</a>
          </div>
          {isCharging !== null && (
            <p>Power Source: {isCharging ? 'Power Adapter' : 'Battery'}</p>
          )}
          <a className='bat'>Battery Settings...</a>
        </div>
      )}
  {dropdownSearch && (
        <div className='dropSearch'>
          <a><i className='fa fa-search'></i></a>
          <input type="search" placeholder='Spotlight Search'/>
        </div>
      )}
      {dropdownControlCentre && (
        <Controlcentre/>
      )}

     <div className="dock-container">
      <WaveBackground />
      <Dock className="dock" width={400} magnification={1} magnifyDirection="up">
        {[finder, launchpad, facetime, applemusic, imsg, pinterest, contact, setting, applestore, bin].map((item, index) => (
